properties.approved_maps:
The 5 United States Geological Survey (USGS) 1:100,000 scale topographic maps used to determine the boundary of the Virginia Peninsula viticultural area are titled: 

(1) Norfolk, Virginia-North Carolina; 1985; 

(2) Petersburg, Virginia, 1984; 

(3) Richmond, Virginia, 1984; 

(4) Tappahannock, Virginia-Maryland; 1984; and 

(5) Williamsburg, Virginia, 1984.

